INSERT INTO `preferencias` VALUES (1,'Marca la casilla del encabezado \"SI\" para indicar las actividades que te gustaría hacer. Marca la casilla del encabezado \"NO\" para señalar aquellas que te desagradaría hacer o que serían indiferentes.','Actividades'),(2,'Marca la casilla del encabezado \"SI\" para indicar las actividades que puedes hacer bien o de manera competente. Marca la casilla del encabezado \"NO\" para señalar aquellas que nunca has llevado acabo o que realizas de manera deficiente.','Habilidades'),(3,'Marca la casilla del encabezado \"SI\" para indicar las ocupaciones que te interesan o te llamas la atención. Marca la casilla del encabezado \"NO\" para indicar las ocupaciones que te desagradan o no te interesan.','Ocupaciones'),(4,'Evalúate a ti mismo(a) en cada una de las siguientes características en comparación con otras personas de tu misma edad. Proporciona la evaluación más exacta de como te ves a ti mismo.\r\nMarca la casilla del encabezado de la calificación que deseas otorgar y evita darle la misma calificación a cada habilidad','Calificación de capacidades');
